Chordizer.H=function(b,a){this.addChord(b,"H",2,a).addMute("LowE").addBarre(1,"A","HighE").addFretPress(3,["D","G","H"])};Chordizer.Hm=function(b,a){this.addChord(b,"Hm",2,a).addMute("LowE").addBarre(1,"A","HighE").addFretPress(2,"H").addFretPress(3,["D","G"])};Chordizer.Hm7=function(b,a){this.addChord(b,"Hm7",2,a).addMute("LowE").addBarre(1,"A","HighE").addFretPress(2,"H").addFretPress(3,["D"])};